import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Axios from 'axios';


class ResourceManager extends Component {

  constructor(props) {
    super(props);
    this.state = {
      columns: [{ "header": "ID", "name": "resourceManagerId" },
      { "header": "NAME", "name": "name" },
      { "header": "Start Date", "name": "startDate" },
      { "header": "End Date", "name": "endDate" }],
      showAdd: false,
      showUpdate: false,
      showDelete: false,
      showRM: true,
      name: null,
      startDate: null,
      endDate: null,
      d:null,
      id: null
    }
    this.handleAdd = this.handleAdd.bind(this);
    this.handleUpdate = this.handleUpdate.bind(this);
    this.handleDelete = this.handleDelete.bind(this);
    this.handleClose = this.handleClose.bind(this);
    // this.handleSubmitAdd = this.handleSubmitAdd.bind(this);
    // this.handleSubmitUpdate = this.handleSubmitUpdate.bind(this);
  }

  handleAdd(event) {
    this.setState({
      showAdd: true,
      showDelete: false,
      showUpdate: false,
      showRM: false
    })
  }

  handleUpdate = (id) => {
    //event.preventDefault();
    // handleUpdate(event, id) {
    console.log("resource manager", this.props.rows[id - 1]);
    console.log("id from update button", id);
    var d = new Date(this.props.rows[id - 1].startDate);
    //var dateStr = JSON.parse(d);
    console.log("start date in props--------------", d)
    this.setState({
      id: id,
      name: this.props.rows[id - 1].name,
      startDate: new Date(this.props.rows[id - 1].startDate),
      endDate: this.props.rows[id - 1].endDate,
      d: new Date(this.props.rows[id - 1].startDate),
      showUpdate: true,
      showAdd: false,
      showDelete: false,
      showRM: false
    })
    // get details for this ID from props



    // Axios({
    //   url:"/{id}",
    //   method: "get",
    //   headers
    // }
  }

  handleDelete(event) {
    this.setState({
      showDelete: true,
      showAdd: false,
      showUpdate: false,
      showRM: false
    })
  }

  handleClose(event) {
    this.setState({
      showUpdate: false,
      showDelete: false,
      showAdd: false,
      showRM: false

    })
  }

  handleOnChange = (event) => {
    debugger
    console.log("line 88", event.target.value);
    let obj = {}

    obj[event.target.id] = event.target.value;

    this.setState({

        ...this.state.id,

        ...this.state.name,

        ...this.state.startDate,

        ...this.state.endDate,

        ...obj


    })

    console.log("onchange =? obj => ", obj)

    console.log('this.state => ', this.state)

  }


  handleSubmitAdd(event) {
    event.preventDefault();
    console.log("Form Add submitted");
    if (this.state.name) {
      let userData = {
        name: this.state.name,
        startDate: this.state.startDate,
        endDate: this.state.endDate

      }

      // debugger
      Axios({
        url: 'http://localhost:9091/resource_manager/',
        method: "post",
        data: userData,
        headers: {
          'Content-Type': 'application/json'
        }
      }).then(res => {
        // debugger
        console.log(this.props);
      }).catch(err => {
        console.log(err);
      })
    }
    this.setState({
      id: null,
      name: null,
      startDate:
        null,
      endDate:
        null,
      showAdd:
        false,
      showDelete:
        false,
      showUpdate:
        false,
      showRM: false

    })

  }
  handleSubmitUpdate(event) {

    event.preventDefault();

    console.log("Form Update submitted");

    if (this.state.name) {

      let userData = {

        resourceManagerId:
          this.state.id,

        name: this.state.name,

        startDate:
          this.state.startDate,

        endDate:
          this.state.endDate

      }

      // debugger

      Axios({

        url: 'http://localhost:9091/resource_manager/' + this.state.id,

        method: "put",

        data: userData,

        headers: {

          'Content-Type':
            'application/json'

        }


      }).then(res => {

        // debugger

        console.log(this.props);

      }).catch(err => {

        console.log(err);

      })

    }

    this.setState({

      id: null,

      name: null,

      startDate:
        null,

      endDate:
        null,

      showAdd:
        false,

      showDelete:
        false,

      showUpdate:
        false,

      showRM: false

    })

  }



  handleSubmitDelete(event) {

    event.preventDefault();

    console.log("Form Delete submitted");

    // debugger

    if (this.state.id) {

      Axios({

        url: 'http://localhost:9091/resource_manager/' +
          this.state.id,

        method: "delete",

        data: "",

        headers: {

          'Content-Type':
            'application/json'

        }


      }).then(res => {

        // debugger

        console.log(this.props);

      }).catch(err => {

        console.log(err);

      })

    }

    this.setState({

      id: null,

      name: null,

      startDate:
        null,

      endDate:
        null,

      showAdd:
        false,

      showDelete:
        false,

      showUpdate:
        false,

      showRM: false

    })

  }

  render() {
    console.log("props--------", this.props);
    console.log("line 314", this.state);
    return (
      <div>
        <table>
          <thead>
            <tr>
              {this.state.columns.map(col =>
                <th key={col.name}>{col.header}</th>
              )}
            </tr>
          </thead>
          <tbody>
            {this.props.rows.map(row =>
              <tr key={row.id}>
                {this.state.columns.map(col =>
                  <td key={col.name}>{row[col.name]}</td>
                )}

                <Button variant="primary" onClick={() => {this.handleUpdate(row.resourceManagerId)}}>update {row.resourceManagerId}</Button>
              </tr>
            )}
          </tbody>
        </table>
        <Button variant="inherit" onClick={this.handleAdd}>
          Add
            </Button>
        <Button variant="primary" onClick={this.handleUpdate}>
          Update
            </Button>
        <Button variant="secondary" onClick={this.handleDelete}>
          Delete
        </Button>


        <Modal show={this.state.showUpdate} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Update Resource Manager</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitUpdate}>
            <Modal.Body>
              <label For="id">ID</label>
              <input id="id" name="id" onChange={this.handleOnChange} value={this.state.id} />
              <label For="name">Name</label>
              <input id="name" name="name" type="text" onChange={this.handleOnChange} value={this.state.name} />
              <label for="startDate">Start Date</label>
              <input type="date" id="startDate" class="form-control" onChange={this.handleOnChange} value="2017-06-23" />
              <label For="endDate">End Date</label>
              <input type="date" id="endDate" class="form-control" onChange={this.handleOnChange} value={this.state.endDate} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form>
        </Modal>

        <Modal show={this.state.showDelete} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Delete New Resource Manager</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitDelete}>
            <Modal.Body>
              <label For="ID">ID</label>
              <input id="ID" type="text" onChange={this.onChange} value={this.state.name} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form>
        </Modal>

        <Modal show={this.state.showAdd} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Add New Resource Manager</Modal.Title>
          </Modal.Header>

          <form onSubmit={this.handleSubmitAdd}>
            <Modal.Body>
              <label For="name">Name</label>
              <input id="name" name="name" type="text" onChange={this.onChange} value={this.state.name} />
              <label for="startDate">Start Date</label>
              <input type="date" id="startDate" class="form-control" onChange={this.onChange} value={this.state.startDate} />
              <label For="endDate">End Date</label>
              <input type="date" id="endDate" class="form-control" onChange={this.onChange} value={this.state.endDate} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form>
        </Modal>

      </div>
    );
  }
}

export default ResourceManager;
